(31, '3Th59qOUeg', 'Quatres étapes pour atteindre votre liberté financière.', '-5901356799704017786_120.jpg', '🔴COMMENT ATTEINDRE LA LIBERTE FINANCIERE ?\r\n\r\nTemps de lecture 2 minutes 12 seconde.\r\nDans cet article nous vous découvrez les quatre étapes importantes qui vont vous aider à atteindre votre liberté financière.\r\nÉtape 1 : Équilibrez votre budget\r\nL’argent est donc un outil qui nous permet de subvenir à nos besoins quotidiens, des plus fondamentaux… aux plus superficiels.\r\n\r\nVos premiers revenus sont le fruit d’un échange de votre temps contre de l’argent. Mais une journée dure 24 heures et votre capacité à générer des revenus d’activités est donc limitée. Il est difficile de « travailler beaucoup plus pour gagner plus ».\r\n\r\nC’est pourquoi le premier de nos conseils, la première étape fondamentale est de gérer votre budget pour équilibrer vos revenus et vos dépenses, quitte à trouver des idées d’économies pour réduire les dépenses. Un train de vie équilibré vous permet d’atteindre le premier niveau de sérénité financière : l’autonomie.\r\n\r\nÉtape 2 : Épargnez vos revenus excédentaires\r\nEn optimisant votre budget, vous devenez capable de dépasser l’équilibre budgétaire et de générer des excédents. Ceux-ci peuvent être stockés dans des réserves qui vous seront utiles pour :\r\n\r\n1. réduire progressivement une dette existante, jusqu’à son remboursement total\r\n2. faire faces aux aléas de la vie et amortir les « coups durs »\r\nfinancer vos projets futurs (plutôt que de faire appel aux crédits conso)\r\n3. vous constituer un patrimoine (résidence principale, placements divers, investissement foncier ou en bourse…)\r\n\r\nÉpargner est l’action la plus saine que vous pouvez faire avec vos revenus d’activité : c’est le signe d’un budget en bonne santé. Vous créez des réserves.\r\n\r\nEn vous aidant à anticiper l’avenir, ces réserves constituent le deuxième pilier de votre sérénité financière. En créant vos propres outils de protection, vous devenez progressivement plus libres. Vous n’êtes plus à la merci d’outils de financements coûteux proposés si facilement par les instituions bancaires.\r\n\r\nÉtape 3 : Apprenez à investir\r\nAprès avoir mis suffisamment d’argent de côté pour vous protéger et financer vos projets d’achats à court et moyen terme, vos réserves excédentaires peuvent être utilisés pour vous constituer un patrimoine à long terme.\r\n\r\nA ce stade, vous apprenez à faire travailler votre argent (et non plus à travailler pour l’argent) pour qu’il génère d’autres revenus, les revenus du patrimoine.\r\n\r\nÉtape 4 : Prenez le chemin de l’indépendance financière\r\nL’indépendance financière consiste à dire au revoir à votre patron et à remplacer votre salaire par des revenus issus d’autres sources : placements financiers (intérêts, dividendes, bourse) ou immobiliers (loyer)…\r\n\r\nCes revenus du patrimoine sont souvent qualifiés de « revenus passifs ». Loin de faire de vous des « capitalistes profiteurs », ces revenus vous permettent de couvrir à leur tour, une partie ou la totalité de vos besoins.\r\n\r\nL’objectif n’est pas de vous enrichir à outrance, mais de gagner en indépendance, en liberté financière dans les moments de votre vie où vous ne serez plus en capacité d’échanger votre temps contre de l’argent (en cas de maladie, de perte d’emploi, ou à la retraite par exemple).\r\n\r\nCe nouvel équilibre vous conduit vers le niveau de sérénité ultime, où vous devenez libre d’affecter votre temps aux activités de votre choix (travail, loisirs, bénévolat…).\r\n\r\nVOUS AVEZ QUELQUES ETAPES QUI POURRAIENT VOUS AIDER A ATTEINDRE LA LIBERTE FINANCIER, A VOUS DE JOUER ET DE LES METTRE EN PRATIQUE.\r\n\r\n\r\nDites nous en commentaire ce que vous pensez de ces étapes et quand vous les mettez en pratique.', 'finance', 'Liberté financière ', '2023-02-11 18:30:33', 1),
(32, '7PGe1gD3NY', 'Les 07 sacrifices qui vous ouvriront les portes de richesse ', '1666476484116.jpg', '<p>\r\n								<h4>7 𝙨𝙖𝙘𝙧𝙞𝙛𝙞𝙘𝙚𝙨 𝙦𝙪𝙞 𝙫𝙤𝙪𝙨 𝙤𝙪𝙫𝙧𝙞𝙧𝙤𝙣𝙩 𝙡𝙚𝙨 𝙥𝙤𝙧𝙩𝙚𝙨 𝙙𝙚 𝙡𝙖 𝙧𝙞𝙘𝙝𝙚𝙨𝙨𝙚</h4>\r\n								<ol>\r\n												<li style=\"color:blue;\">\r\n																Finis les grâces matinées\r\n												</li>\r\n												<p>\r\n														Devenir riche ça se mérite et il est nécessaire de faire des sacrifices pour arriver à la richesse, car rien de ce qui a de la valeur ne s\'obtient sans effort. En effet dormir jusqu\'à tard dans la journée ne fera que vous faire perdre un temps précieux et de multiples opportunités. Il est donc primordial de vous lever tôt pour gagner plus de temps sur votre journée que vous pourrez consacrer à une formation ou un projet.\r\n												</p>\r\n												<li style=\"color:blue;\">\r\n																Renoncer aux sorties tardives\r\n												</li>\r\n												<p>\r\n																Se lever tôt implique de dormir plus tôt afin de permettre à l\'organisme de bénéficier de temps de sommeil adéquat pour être en bonne santé. Alors si vous êtes un fêtard faite l\'effort de vous arranger pour dormir entre 21 h 30 et 00 h 00 cela peut sembler pénible, mais si vous y arrivez aurez un gain d\'énergie indispensable à la réalisation de vos projets.\r\n												</p>\r\n												<li style=\"color:blue;\">\r\n																Renoncer aux drogues et à l\'alcool.\r\n												</li>\r\n												<p>\r\n																La richesse se mérite et pour prétendre la vouloir vous devez être sobre.\r\n La cigarette, les drogues et l\'alcool constituent un frein à votre richesse, car il vous prive d\'un bien essentiel à la richesse qui est la sobriété. Rarement lucides, les alcooliques qui ne peuvent pas prendre des décisions bénéfiques pour leur business à l\'exemple des fumeurs, quand ils sont en manque, deviennent nerveux et ne peuvent plus se concentrer sur quelque chose temps qu\'ils n\'ont pas leur dose de nicotine .\r\n    Ce qui peut être très néfaste pour votre productivité. De plus, cela vous coûte cher, vous ferez mieux d\'épargner cet argent afin de le consacrer à une idée future.\r\n												</p>\r\n												<li style=\"color:blue;\">\r\n																Passé moins de temps avec ces amis.\r\n												</li>\r\n												<p>\r\n																Devenir riche demande un grand sacrifice de temps. Alors il convient de limiter au maximum son temps passé à ne rien faire ou à se distraire pour pouvoir avoir plus de temps que vous consacrerez à l\'apprentissage et à vos différences business. Gardez à l\'esprit que vous allez devoir sacrifier une partie de votre vie sociale pour atteindre la richesse.\r\n												</p>\r\n												<li style=\"color:blue;\">\r\n																Éloignez-vous des personnes négatives\r\n												</li>\r\n												<p>\r\n																On a tous dans notre entourage ces personnes qui passent le temps à se plaindre de leur situation sans pour autant lever le petit doigt afin de faire bouger les choses. Cette personne qui peut passer des heures rien que pour essayer de vous convaincre que votre idée ne marchera pas. Vous devez à tout prix vous éloigner de ces personnes, car les gens que nous côtoyons influent directement sur nos actions. Cela peut être difficile, mais pas impossible de trouver des personnes positives qui ont les mêmes visions que vous et qui sont prêtes à vous encourager dans votre aventure.\r\n												</p>\r\n												<li style=\"color:blue;\">\r\n																Oubliez le luxe inutile\r\n												</li>\r\n												<p>\r\n																Avoir une gestion du portefeuille rigoureuse est l\'une des qualités à posséder pour espérer être riche. En effet, sachez faire la différence entre vos besoins réels et le reste cela vous permettra d\'accroître votre potentiel d\'épargne ainsi, vous serez plus prêt financièrement pour la mise en place de votre projet.\r\n												</p>\r\n												<li style=\"color:blue;\">\r\n																Travailler intelligemment sans être payé\r\n												</li>\r\n												<p>\r\n																Le sacrifice ultime que vous devriez faire si vous décidez de devenir riche d\'accepter de travailler sans pour autant percevoir quelque chose. En effet, travailler pour l\'argent influence négativement vos performances et vos acquis, cela vous empêche de vous focaliser sur l\'apprentissage indispensable pour établir un profil solide qui vous préparera à une richesse certaine. <br><br>\r\n																Il est permis à tout le monde de devenir riche à condition de payer le prix pour et cela revient à faire des sacrifices et être discipliné afin de vous faciliter le chemin qui même à l\'indépendance financière .\r\nmerci  d\'avoir lu cet article.\r\n												</p>\r\n								</ol>\r\n				</p>', 'finance', 'Richesse ', '2023-02-18 20:03:11', 1),
(33, 'gBGylmlCn4', 'Les bonnes pratiques pour attirer les bonnes personnes ', '1670646556468.jpg', '10 FAÇONS  D’ATTIRER DES RELATIONS PLUS POSITIVES DANS VOTRE VIE. \r\n\r\n1- Sortez des ambiances négatives\r\n\r\nSortir des ambiances négatives peut avoir un sens littéral et un sens figuré : quitter physiquement un lieu ou faire le tri dans sa tête.\r\n\r\nLa négativité est partout autour de nous et en nous-mêmes, affectant notre bonheur et nos relations. Le vrai mal est fait quand on reste dans ces espaces négatifs. Alors, faites de votre mieux pour vous en éloigner et attirer les bonnes personnes dans votre vie.\r\n\r\n2- Arrêtez de vous plaindre et ne permettez pas aux autres de se plaindre devant vous\r\n\r\nNous avons tous besoin d’un endroit sûr pour exprimer nos douleurs – ce n’est pas le problème. Toutefois, il est difficile de nouer des relations lorsque la même souffrance fait l’objet de discussions pendant de longues périodes.\r\n\r\nLa personne qui se plaint n’est pas l’unique responsable, celle qui l’écoute l’est également ! En matière de plaintes, fixez donc des limites pour vous et pour ceux qui vous entourent. Dévider son chapelet est une bonne chose lorsqu’elle est suivie par l’acceptation de la situation telle qu’elle est ou par la prise de mesures pour la changer.\r\n\r\n3- Aimez-vous d’abord, puis partagez cet amour. \r\n\r\nVous ne pouvez pas nouer des relations positives dans votre vie sans d’abord vous aimer pour qui vous êtes. Une fois devenu vous-même une priorité dans votre vie, vous serez bien placé pour établir des relations positives et stimulantes qui vous soutiendront et soutiendront vos objectifs.\r\n\r\n4- Honorez le passé, mais n’y vivez pas. \r\n\r\nOn parle souvent du fait de laisser tomber le passé. Nous avons du mal à accepter ce concept parce que c’est arrivé, et cela fait partie de ce que nous sommes. Laisser aller, ce n’est pas oublier complètement, c’est libérer l’emprise émotionnelle que ce passé a sur nous. Dans l’idéal, nous devrions honorer le passé pour les leçons qu’il nous a enseignées, tout en nous engageant dans la liberté de choisir en toute indépendance.\r\n\r\n5- Ayez confiance en votre pouvoir\r\n\r\nNotre pouvoir provient d’une ferme conviction en ce que nous pouvons faire. Lorsque nous commençons à abaisser cette convictions au niveau de celle des autres, nous renonçons à ce pouvoir. Cela veut dire que nous sommes les premiers responsables de notre perte de pouvoir.\r\n\r\n6- Défendez ce que vous savez être votre vérité. \r\n\r\nÉcoutez ce que les autres ont à dire, mais n’y croyez pas toujours. Vous seul pouvez connaître votre propre valeur et elle ne se trouve pas dans l’opinion de quelqu’un d’autre à votre égard.\r\n\r\nIl en va de même pour les éloges. Nous sommes prêts à les accepter comme un fait, alors que ce sont aussi de faux sentiments de notre véritable valeur. En respectant cette rigueur de pensée, vous attirerez les bonnes personnes pour devenir vos proches.\r\n\r\n7- Considérez le « non » comme une réponse positive\r\n\r\nQue vous donniez ou receviez un «non», considérez cela comme un cadeau. Le « non » va vous éviter de vivre une expérience qui ne vous convient pas, et plutôt vous permettre de soutenir et d’honorer les choses qui comptent le plus. Grâce à lui, vous laisserez à l’écart les choses qui pourraient diminuer votre énergie et votre pouvoir.\r\n\r\n8- Trouvez la joie dans chaque expérience\r\n\r\nCertes, trouver la joie dans chaque expérience peut parfois être difficile, mais en vue d’attirer les bonnes personnes dans votre vie, il faut le faire. En vérité, les personnes positives sont attirées par d’autres personnes positives. \r\n\r\nCherchez le bon côté, la bonne leçon à tirer de chaque situation. Non seulement cela vous aidera à garder un bon état d’esprit, mais cela amènera également plus de personnes positives dans votre vie.\r\n\r\n9- Arrêtez de vous inquiéter\r\n\r\nCela ne sert à rien, qu’aucun problème n’a été résolu car une personne s’inquiétait plus que l’autre. Malheureusement, quand nous sommes en proie à l’inquiétude, toute la logique passe par la fenêtre. \r\n\r\nLa meilleure façon d’éliminer l’inquiétude est alors de prendre des décisions, car une activité productive fait passer votre esprit de l’inquiétude à la résolution du problème.', 'evénements', 'Amitié', '2023-02-22 19:17:02', 1),
(34, '4zz6dX0ixp', 'L\'argent fait-il le bonheur ', '1646384566048.jpg', '“L’argent ne fait pas le bonheur” 🥴\r\n\r\nCette phrase, c’est la phrase préférée des personnes “pauvres”… 🤦🏻‍♂️\r\n\r\nSérieusement, il faut être plus que naïf pour dire cela…\r\n\r\nBien évidemment l’argent ne fait pas directement le bonheur.\r\n\r\nPar contre, il permet d’éviter énormément de problèmes et apporte beaucoup de confort ✅\r\n\r\nNe pas avoir à se soucier de réussir à payer ses factures en fin de mois, cela enlève un poids énorme mentalement.\r\n\r\nEt puis pouvoir se payer des vacances et profiter de la vie c’est encore mieux ! 🙌\r\n\r\nQuel est ton avis sur le sujet ?', 'finance', 'L\'argent ', '2023-03-13 21:18:40', 1),
(35, 'MaiAh3TEtR', 'Prise de conscience ', '1666618958612.jpg', 'À Méditer : chers jeunes âgés de 25 À 35 Ans.\r\nNe commettez pas les erreurs que certains de nos aînés ont commises.\r\nMariez-vous si possible avec le peu que vous avez. Ne vous attendez pas à être millionnaire faîtes des enfants, quoi qu\'il en coûte, même si c\'est pour grandir avec eux.\r\nGrandissez avec vos enfants et réussissez avec votre femme. Vous ne finirez jamais de gagner de l\'argent, de finir avec de longues études ou de réaliser vos projets .\r\nIl est fort probable que vous ne réussissiez pas dans votre année cible. Alors commencer votre vie tôt, avec constance et sérieux vous grandirez.\r\n\r\nQuand j\'avais 20 Ans, je parlais d\'être riche avant de me marier. Alors mon père papa KAMDOUM MAGANG de regretter mémoire m\'a dit : qu\'il a eu très tôt l\'opportunité d\'épouser les plus belles amour de sa vie, mais sa peur était, est-ce que je peux vraiment prendre soin d\'elles ? Mais aujourd\'hui, nous avons des enfants qui ont déjà des petits-enfants et des arrières-petits-enfants. Et c\'est ma richesse par contre le riche en argent ou en matériel ne pourra s\'offrir ce privilège. même si je reconnais qu\'il existe des \"chanceux\" qui ont tout ça à la fois. Pense s\'y mon fils N\r\n\r\nTravaillez dur pendant que vous-êtes en avance et rassembler ce qui vous appartient pendant votre Jeunesse.\r\n\r\nNe prolongez pas votre mariage parce que vous n\'avez pas ce que la société exige aujourd\'hui. (l\'argent, le bien matériel)\r\n\r\nNe prenez jamais de crédit pour vous marier.\r\n\r\nNe comptez jamais sur l\'aide des tiers pour organiser votre mariage.\r\n\r\nNe commettez pas les erreurs de certains de vos aimés vouloir PLAIRE.\r\n\r\nCroyez-moi, ce n\'est pas seulement l\'argent mais la maturité qui nous pousse à être fidèles. Votre bonheur dépend entièrement de votre sagesse et de la façon dont vous gérez votre vie.\r\nAvec une vie bien planifiée, vous serez plus heureux.\r\n\r\nCroyez-moi, ce n\'est pas une question d\'argent.\r\n\r\n Quel est notre problème ?\r\n\r\nConstruire des manoirs, acheter la dernière marque de voiture, épousé la plus belle femme, mais nous n\'avons toujours pas ces choses dont nous rêvons, et bien sûr les années que nous avons perdues, nous ne pourrons les avoir.\r\n\r\nS\'il vous plaît n\'ayez pas 60 Ans et vos 1er enfants auront 20 ou 22 Ans. Que pourriez-vous encore faire pour eux à cet âge ?\r\n\r\nMariez-vous, n\'ayez pas peur, cette fille, ce gars en qui vous trouvez beaucoup de défauts à de nombreuses qualités si vous êtes bien centré psychologiquement.\r\n\r\nNe pense plus que tu auras tout avant de t\'installer avec elle. Les DIEUX peuvent changer le coup de votre vie en un clin d\'œil, avec une bonne concentration et une vaillante femme à vos côtés, vous réussissez. NSW', 'evénements', 'Message aux jeunes ', '2023-03-13 21:26:08', 1),
(36, 'hIJ5P8Ootv', 'Le bonheur et le succès,quel lien tiré ?', 'images.jpeg', '\r\n\"Le succès n\'est pas la clé du bonheur. Le bonheur est la clé du succès. Si vous aimez ce que vous faites, vous réussirez.\" - Albert Schweitzer\r\n\r\n\r\nCette citation d\'Albert Schweitzer suggère que le bonheur et le succès sont étroitement liés, mais que le bonheur doit être la priorité pour atteindre le succès véritable. Selon lui, le fait de trouver le bonheur dans ce que l\'on fait, dans sa passion ou dans son travail, est la clé pour réussir.\r\n\r\nBeaucoup de gens pensent que le succès apporte automatiquement le bonheur, mais selon cette citation, ce n\'est pas toujours vrai. Parfois, les gens peuvent atteindre un certain niveau de succès, mais s\'ils ne sont pas heureux ou épanouis, leur succès peut être vide et sans valeur.\r\n\r\nEn revanche, si vous trouvez quelque chose que vous aimez vraiment et qui vous rend heureux, vous serez naturellement plus motivé pour y travailler dur et vous serez plus enclin à prendre des risques pour atteindre vos objectifs. Cela peut conduire à un succès plus durable et satisfaisant, car vous êtes plus susceptible de vous sentir satisfait de ce que vous avez accompli.\r\n\r\nEn somme, cette citation nous rappelle que le bonheur doit être notre priorité et que si nous pouvons trouver le bonheur dans ce que nous faisons, le succès suivra naturellement.\r\n\r\nQu\'est-ce que tu en penses toi?\r\n\r\n', 'evolution', 'Bonheur et succès ', '2023-03-15 08:42:59', 1),
(37, 'D35hfRs7y7', 'Les qualités d\'un leader ', '1666132147419.jpg', '⏺Les qualités d\'un leader : \r\n\r\nLes qualités d\'un leader peuvent varier en fonction de la situation et du contexte, mais voici quelques-unes des qualités généralement reconnues comme importantes pour un bon leader :\r\n\r\nVision : un leader doit avoir une vision claire de l\'avenir et savoir où il veut aller.\r\n\r\nCommunication : un leader doit être capable de communiquer efficacement avec les membres de son équipe et de les motiver.\r\n\r\nConfiance : un leader doit être confiant dans ses capacités et dans celles de son équipe.\r\n\r\nResponsabilité : un leader doit être responsable de ses actions et de celles de son équipe.\r\n\r\nAdaptabilité : un leader doit être capable de s\'adapter aux changements et de trouver des solutions créatives aux problèmes.\r\n\r\nEmpathie : un leader doit être capable de comprendre les besoins et les sentiments de ses membres d\'équipe.\r\n\r\nIntégrité : un leader doit être honnête et éthique dans toutes ses actions.\r\n\r\nDétermination : un leader doit être déterminé à atteindre ses objectifs et à surmonter les obstacles.\r\n\r\nPrise de décision : un leader doit être capable de prendre des décisions difficiles et de résoudre les problèmes rapidement.\r\n\r\nCapacité à inspirer : un leader doit être capable d\'inspirer ses membres d\'équipe à atteindre leurs objectifs et à réaliser leur plein potentiel.\r\n\r\n💬Qu\'en pensez-vous ?  Quelles sont les autres qualités selon vous?', 'evolution', 'Le leader ', '2023-03-15 20:59:26', 1),
(38, '15kkpUQ5JX', 'Business ', '1652454246865.jpg', 'Un business qui ne fait rien d\'autre que de l\'argent est un business pauvre.\" - Henry Ford\r\n\r\nCette citation de Henry Ford souligne l\'importance pour un business de ne pas se concentrer uniquement sur la génération de profits, mais plutôt sur la création de valeur pour ses clients et la société dans son ensemble. En effet, un business qui ne se préoccupe que de l\'argent risque de négliger les besoins et les attentes de ses clients, ce qui peut finalement conduire à une baisse de ses ventes et de sa rentabilité.\r\n\r\nEn outre, les entreprises qui ne prennent pas en compte les considérations sociales et environnementales peuvent rencontrer des problèmes de réputation et être confrontées à des réglementations plus strictes. Ainsi, pour être durable et prospère à long terme, un business doit non seulement générer des profits, mais aussi créer de la valeur pour toutes les parties prenantes, y compris les clients, les employés, les communautés locales et l\'environnement.', 'evolution', 'Business ', '2023-03-16 20:14:45', 1),
(39, 'DjHi2IJxP5', 'Soit toi même ', 'IMG_20230317_002928_308.jpg', '👀 On passe sa vie à faire attention, à ne pas sortir du rang, à ne pas faire déranger, à essayer d\'être comme tout le monde.\r\n \r\nMais à force de ne jamais prendre de risque, on finit par s\'en faire une habitude, en s\'oubliant chaque jour un peu plus ⌛ !\r\n \r\nPourtant, pour avancer dans la vie, que ce soit personnelle ou professionnelle, il faut oser  !\r\n \r\n🎯 Alors, demander plutôt que de rester dans le doute, faites le premier pas plutôt que de rester dans votre coin, sortez de votre zone de confort plutôt que de finir avec des regrets !\r\n \r\nLa vie est un défi à relever, vous ne gagnerez pas toujours, mais vous apprendrez et sortirez grandi de vos échecs 😉.\r\n \r\nNe partez pas vaincu d’avance, osez être vous-même, imposez-vous, jetez vous à l’eau !\r\n\r\n🔥 Essayez et vous serez surpris du résultat bien plus souvent que vous ne le pensez, dans la plupart des cas, nous nous mettons des barrières qui n\'existent que dans notre tête.\r\n', 'evolution', 'Prend le risque ', '2023-03-16 23:34:59', 1),
(40, 'StxTYwgDmP', 'Dernier mots de Steve Jobs ', '1679042472074.jpg', 'Les derniers mots de Steve Jobs, milliardaire, mort à 56 ans :\r\n\r\n\"J\'ai atteint le summum du succès dans le monde des affaires. Dans les yeux des autres, ma vie est une réussite.\r\n\r\nCependant, mis à part le travail, j\'ai eu peu de joie.\r\n\r\n En fin de compte, la richesse n\'est qu\'un fait auquel je me suis habitué.\r\n\r\nEn ce moment, allongé sur mon lit d’hôpital, et me rappelant toute ma vie, je me rends compte que toute la reconnaissance et la richesse dans laquelle j’ai pris tant de fierté, a pâli et est devenue insignifiante face à la mort imminente.\r\n\r\nVous pouvez employer quelqu\'un pour conduire votre voiture ou gagner de l\'argent pour vous, mais c’est impossible d’engager quelqu\'un pour supporter la maladie et mourir pour vous.\r\n\r\nLes choses matérielles perdues peuvent être retrouvées. Mais il y a une chose qui ne peut jamais être trouvée quand elle est perdue : la Vie. \r\n\r\nQuelle que soit l\'étape de la vie à laquelle nous sommes actuellement, avec le temps, nous serons confrontés au jour où le rideau se ferme.\r\n\r\nAimez votre famille, votre conjoint, vos enfants et vos amis... Traitez-les bien.\r\n\r\n Chérissez-les.\r\n\r\nAu fur et à mesure que nous vieillissons, et devenons plus sages, nous réalisons lentement que porter une montre à 300 $ ou 30 $, les deux donnent la même heure\r\n\r\nQue nous avons un portefeuille ou un sac à main de 300 $ ou de 30 $, le montant à l’intérieur est le même. \r\n\r\nQue nous conduisons une voiture de 150 000 $ ou une voiture de 30 000 $, la route et la distance sont les mêmes, et nous arrivons à la même destination.\r\n\r\nQue nous buvons une bouteille de vin à 1000$ ou à 10 $, la gueule de bois est la même. \r\n\r\nQue la maison dans laquelle nous vivons mesure 100 ou 1000 mètres carrés, la solitude est la même.\r\n\r\nVous réaliserez que votre véritable bonheur intérieur ne provient pas des choses matérielles de ce monde.\r\n\r\nQue vous voyagez en première classe ou en classe économique, si l\'avion tombe en panne, vous tombez avec lui...\r\n\r\nPar conséquent, j\'espère que vous vous rendez compte, quand vous avez des amis, des frères et sœurs, avec qui vous discutez, riez, parlez, chantez, parlez du nord-sud-est ou du ciel et la terre,... c\'est le vrai bonheur !!\r\n\r\nUn fait incontestable de la vie :\r\nN\'éduquez pas vos enfants à être riches. \r\n\r\nÉduquez-les pour être heureux. \r\n\r\nQuand ils grandiront, ils connaîtront la valeur des choses et non le prix.\"', 'evénements', 'Les derniers mots de Steve Jobs ', '2023-03-17 12:52:50', 1),
(41, 'VTxUdW1Oo5', 'Ne court pas derrière une femme sans une stabilité.', 'IMG_20230311_210943_179.jpg', 'TA STABILITÉ EST PLUS IMPORTANTE QUE ELLES!\r\n\r\nNe cours pas après les femmes, cours après ta stabilité...\r\n\r\nCe n\'est pas la femme qui viendra t\'apporter la stabilité comme on te le fait croire!\r\n\r\nC\'est toi qui n\'arrive pas à manger trois fois par jour, et c\'est toi qui recherche désespérément une relation amoureuse...\r\n\r\nDéjà que ce n\'est pas de ton rôle,\r\n\r\nMais celui de la femme.\r\n\r\nL\'homme cherche l\'argent et la stabilité\r\n\r\nLa femme vient le rejoindre dans sa stabilité.\r\n\r\nLe pourquoi tu constateras que la stabilité financière est consciemment ou inconsciemment le premier critère de choix de la femme mature, sa famille avec.\r\n\r\nOn a souvent tendance à penser que les femmes sont matérialistes...\r\n\r\n...mais non!\r\n\r\nElles ne sont pas matérialistes,elles sont juste logiques.\r\n\r\nIl y\'a une catégorie de femme qui te donnera l\'impression qu\'elle n\'est pas intéressée par le matériel...\r\n\r\n ...même si parfois elle le dit où le croit réellement par amour,la réalité c\'est que inconsciemment, elle aura tendance à rechercher cette stabilité ailleurs si tu ne l\'a pas ou si tu tardes à l\'avoir.\r\n\r\nJe sais que la société te met la pression...\r\n\r\n...Mais ne cède pas!\r\n\r\n Parce que, ces mêmes gens qui aujourd\'hui te poussent à te marier, seront les mêmes à te traiter d\'irresponsable et à se moquer de toi lorsque ta femme s\'en ira.\r\n\r\n En fin de compte,tu seras seul responsable  des conséquences de ton instabilité financière dans ton mariage ou ce qui en tiendra lieu.', 'evénements', 'La femme ', '2023-03-17 20:18:01', 1),
(42, 'FWEGWbv95V', 'Algorithme du travail pour réussir ', 'IMG_20230317_231543_082.jpg', 'Algorithme de travail pour réussir 💪\r\n\r\n- Croyez en vous.\r\n C\'est probablement l\'aspect le plus important.\r\n\r\n- Prendre des risques.\r\n La seule chose qui vous éloigne de vos rêves est la peur.\r\n\r\n- Travail.\r\n C\'est bien mieux que de rester assis dans son pantalon sur le canapé. C\'est prometteur, surtout si vous travaillez dur.\r\n\r\n- Un peu d\'égoïsme.\r\n Pensez davantage à vous-même, mais n\'oubliez pas les autres. Donnez-vous juste plus d\'attention.', 'technologie', 'Algorithme du travail ', '2023-03-17 22:34:55', 1),
(43, 'Kfs1DRVbQY', 'Les 7 points pour conclure une vente.', '1640195955379.jpg', 'Les 7 points pour conclure une vente.\r\n\r\n• Le client doit vous aimer et vous faire confiance avant même d’acheter votre produit… \r\n\r\n• Préparez vos arguments avant le rendez vous.\r\n\r\n• Anticipez les objections en avance.\r\n\r\n• Prévoyez un petit cadeau lors du 1er rendez vous.\r\n\r\n• Ne laissez jamais un client sans nouvelle de vous.\r\n\r\n• Soignez vos cartes de visite, c’est ce qu’il reste de vous après votre départ.\r\n\r\n• Préparez votre USP.\r\n', 'finance', 'Conclure une vente ', '2023-03-23 22:00:08', 1),
(44, 'ZYWm3iE7FU', '5 conseils pour les entrepreneurs ', 'image.jpg', '5⃣ précieux conseils pour tout entrepreneur ! \r\n\r\n1. Agissez maintenant !\r\n Si vous voulez faire quelque chose de grand un jour, rappelez-vous qu\'un jour, c\'est aujourd\'hui. —Georges Lucas\r\n\r\n2. Croyez en votre succès contre vents et marées !\r\nIl n\'y a que deux façons de vivre la vie. La première est que les miracles n\'existent pas. La seconde - comme s\'il n\'y avait que des miracles! - Albert Einstein\r\n\r\n3. Donnez à votre rêve au moins une heure de votre temps, mais tous les jours. Le travail quotidien est la clé de votre succès !\r\nTous les \"bons moments\" sont toujours le résultat de votre travail acharné et de votre dévouement constant dans le passé. Ce que vous faites aujourd\'hui est la clé des résultats de demain. Si vous voulez en récolter les bénéfices demain, semez des graines tous les jours ! Si vous affaiblissez votre concentration même pendant une minute, vous commencerez inévitablement à reculer. -Donald Trump\r\n\r\n4. Ne faites que ce que vous aimez le plus. Cela vous mènera certainement au succès!\r\nChaque matin, je me regardais dans le miroir et demandais : « Si aujourd\'hui était le dernier jour de ma vie, est-ce que j\'aimerais faire ce que je fais aujourd\'hui ? Et si la réponse pendant plusieurs jours de suite était \"non\", je savais que je devais changer quelque chose. -Steve Jobs\r\n\r\n5. N\'abandonnez jamais !\r\nNotre grand défaut est que nous abandonnons trop vite. Le moyen le plus sûr de réussir est de continuer à essayer une fois de plus. - Thomas Edison. ', 'evénements', '5 conseils pour les entrepreneurs ', '2023-03-25 19:47:56', 1),
(45, 'GL36QUOXyJ', 'Psychologie d\'un entrepreneur web', '27245d0fd858792d08fd8e5cad6ebb4fb4-jack-ma.jpg', 'La psychologie d\'un entrepreneur en ligne \r\n\r\nLa psychologie de l\'entrepreneur en ligne est un élément important du succès dans ce domaine. Les entrepreneurs en ligne doivent être passionnés, persévérants et capables de gérer l\'incertitude et les risques inhérents à la création d\'une entreprise.\r\n\r\nVoici quelques éléments clés de la psychologie de l\'entrepreneur en ligne :\r\n\r\nLa passion : les entrepreneurs en ligne réussissent souvent parce qu\'ils sont passionnés par leur entreprise et qu\'ils croient en leur produit ou service. Cette passion les aide à surmonter les obstacles et à persévérer dans les moments difficiles.\r\n\r\nLa créativité : les entrepreneurs en ligne doivent être créatifs pour trouver de nouvelles idées et solutions pour leur entreprise. Ils doivent être capables de penser de manière innovante pour se démarquer de la concurrence et offrir des produits ou services uniques.\r\n\r\nLa résilience : les entrepreneurs en ligne doivent faire face à l\'incertitude et aux risques inhérents à la création d\'une entreprise. Ils doivent être capables de surmonter les échecs et les revers et de continuer à avancer malgré les obstacles.\r\n\r\nL\'adaptabilité : les entrepreneurs en ligne doivent être en mesure de s\'adapter rapidement aux changements de marché et aux nouvelles tendances. Ils doivent être capables de pivoter leur entreprise si nécessaire pour rester compétitifs.\r\n\r\nLa discipline : les entrepreneurs en ligne doivent être disciplinés et organisés pour gérer efficacement leur temps et leurs ressources. Ils doivent être capables de se concentrer sur les tâches les plus importantes et de suivre un plan d\'action clair pour atteindre leurs objectifs.\r\n\r\nEn résumé, la psychologie de l\'entrepreneur en ligne joue un rôle important dans le succès de leur entreprise. Les entrepreneurs en ligne doivent être passionnés, créatifs, résilients, adaptables et disciplinés pour réussir dans ce domaine compétitif.\r\n\r\n', 'technologie', 'Comment réussir un Business en ligne ', '2023-03-27 19:12:25', 1),
(46, 'qPZXgtbGrN', '5 erreurs courantes des fondateurs de startups pour la première fois', 'file.png', '5 erreurs courantes des fondateurs de startups pour la première fois\r\n\r\nIl n\'y a pas d\'entreprise sans erreurs. Surtout si c\'est votre première tentative. Vous vous sentez libre de prendre des décisions, mais vous n\'avez pas encore assez d\'expérience pour ne pas échouer.\r\n\r\nSans aucun doute, apprendre de ses erreurs est efficace. Mais vous pouvez essayer de les prévenir en étudiant l\'expérience de vos collègues. Voici les plus courants :\r\n\r\n🤦‍♂️ Embauche d\'employés à temps plein avant l\'adéquation produit-marché. L\'adéquation produit-marché est la seule chose qui compte dans les premières années de votre entreprise. En termes simples, avez-vous quelque chose que les gens aiment vraiment.\r\n\r\nJusqu\'à ce point, vous essaierez frénétiquement de nombreuses idées, parfois chaque semaine. Pendant ce temps, toute personne autre qu\'un co-fondateur sera bientôt frustrée par les changements de direction et finira par se demander si la compensation qu\'elle abandonne ailleurs en vaut la peine.\r\n\r\n🤦‍♂️ Déprioriser les talents offshore. Économiser de l\'argent est crucial dans les premiers jours. La plus grande dépense est la main-d\'œuvre et compte tenu de la qualité des talents dans le monde et des outils pour collaborer avec eux, l\'embauche à l\'étranger est le meilleur moyen d\'économiser de l\'argent dès le début.\r\n\r\nEssayez de rechercher des employés de pays ou de régions moins riches plutôt que des centres mondiaux et des grandes villes. Ainsi, vous pouvez payer moins cher et obtenir les mêmes résultats.\r\n\r\n🤦‍♂️ Garder la première idée bien trop longtemps. Votre première idée va très probablement échouer. Cela peut sembler une grossière généralisation, d\'autant plus que vous venez probablement de quitter un emploi pour lancer votre startup sur la base d\'une idée que vous jugez très bonne.\r\n\r\nMais le succès avec les startups vient généralement d\'idées que personne d\'autre n\'a. Et ils sont rarement trouvés dans une enquête mais plutôt appris par l\'échec. \r\n\r\nLa clé du succès est donc de parcourir rapidement les idées et d\'obtenir ces informations rapidement.\r\n5 erreurs courantes des fondateurs de startups pour la première fois\r\n\r\nIl n\'y a pas d\'entreprise sans erreurs. Surtout si c\'est votre première tentative. Vous vous sentez libre de prendre des décisions, mais vous n\'avez pas encore assez d\'expérience pour ne pas échouer.\r\n\r\nSans aucun doute, apprendre de ses erreurs est efficace. Mais vous pouvez essayer de les prévenir en étudiant l\'expérience de vos collègues. Voici les plus courants :\r\n\r\n🤦‍♂️ Embauche d\'employés à temps plein avant l\'adéquation produit-marché. L\'adéquation produit-marché est la seule chose qui compte dans les premières années de votre entreprise. En termes simples, avez-vous quelque chose que les gens aiment vraiment.\r\n\r\nJusqu\'à ce point, vous essaierez frénétiquement de nombreuses idées, parfois chaque semaine. Pendant ce temps, toute personne autre qu\'un co-fondateur sera bientôt frustrée par les changements de direction et finira par se demander si la compensation qu\'elle abandonne ailleurs en vaut la peine.\r\n\r\n🤦‍♂️ Déprioriser les talents offshore. Économiser de l\'argent est crucial dans les premiers jours. La plus grande dépense est la main-d\'œuvre et compte tenu de la qualité des talents dans le monde et des outils pour collaborer avec eux, l\'embauche à l\'étranger est le meilleur moyen d\'économiser de l\'argent dès le début.\r\n\r\nEssayez de rechercher des employés de pays ou de régions moins riches plutôt que des centres mondiaux et des grandes villes. Ainsi, vous pouvez payer moins cher et obtenir les mêmes résultats.\r\n\r\n🤦‍♂️ Garder la première idée bien trop longtemps. Votre première idée va très probablement échouer. Cela peut sembler une grossière généralisation, d\'autant plus que vous venez probablement de quitter un emploi pour lancer votre startup sur la base d\'une idée que vous jugez très bonne.\r\n\r\nMais le succès avec les startups vient généralement d\'idées que personne d\'autre n\'a. Et ils sont rarement trouvés dans une enquête mais plutôt appris par l\'échec. \r\n\r\nLa clé du succès est donc de parcourir rapidement les idées et d\'obtenir ces informations', 'evénements', 'Startup ', '2023-03-27 19:27:13', 1),
(47, 'zaATeT3IrF', 'Les étapes de gestion de problème ', '1680434824661.jpg', 'Les étapes de la gestion d\'un problème \r\n\r\nAujourd\'hui,je vais vous donner quelques processus pour bien gérer vos différents problèmes.\r\nCe astuces fonctionne très bien pour moi et pour certains d\'autres.\r\nNoté que la gestion d\'un problème peut être un processus complexe, mais il peut généralement être divisé en plusieurs étapes clés :\r\n\r\n1. Définition du problème : il est important de comprendre clairement ce qui cause le problème et d\'identifier les facteurs qui y sont associés.\r\nCollecte de données : il est nécessaire de collecter toutes les informations pertinentes pour comprendre le problème et ses causes profondes.\r\n\r\n2. Analyse du problème : une fois les données collectées, il est important d\'analyser les informations pour déterminer les causes du problème et les facteurs qui le soutiennent.\r\n\r\n3. Génération de solutions : une fois les causes du problème identifiées, il est possible de générer des solutions potentielles. Il peut être utile de consulter d\'autres personnes pour obtenir plus d\'idées.\r\n\r\n4.Évaluation des solutions : il est important d\'évaluer les solutions potentielles pour déterminer laquelle est la plus appropriée pour résoudre le problème.\r\n\r\n5. Mise en œuvre de la solution : une fois la solution choisie, il est temps de la mettre en œuvre. Cela peut impliquer de prendre des mesures concrètes pour résoudre le problème.\r\n\r\n6. Évaluation des résultats : après avoir mis en œuvre la solution, il est important d\'évaluer les résultats pour savoir si le problème a été résolu de manière satisfaisante.\r\n\r\n7.Amélioration continue : si nécessaire, il peut être nécessaire d\'améliorer ou de modifier la solution pour garantir que le problème ne se reproduise pas à l\'avenir.\r\n\r\nIl est important de noter que ces étapes ne sont pas toujours linéaires et peuvent varier en fonction de la situation. Par conséquent, il est important de s\'adapter et de s\'ajuster en fonction de chaque situation unique pour garantir une gestion efficace des problèmes.\r\nLes étapes de la gestion d\'un problème \r\n\r\nAujourd\'hui,je vais vous donner quelques processus pour bien gérer vos différents problèmes.\r\nCe astuces fonctionne très bien pour moi et pour certains d\'autres.\r\nNoté que la gestion d\'un problème peut être un processus complexe, mais il peut généralement être divisé en plusieurs étapes clés :\r\n\r\n1. Définition du problème : il est important de comprendre clairement ce qui cause le problème et d\'identifier les facteurs qui y sont associés.\r\nCollecte de données : il est nécessaire de collecter toutes les informations pertinentes pour comprendre le problème et ses causes profondes.\r\n\r\n2. Analyse du problème : une fois les données collectées, il est important d\'analyser les informations pour déterminer les causes du problème et les facteurs qui le soutiennent.\r\n\r\n3. Génération de solutions : une fois les causes du problème identifiées, il est possible de générer des solutions potentielles. Il peut être utile de consulter d\'autres personnes pour obtenir plus d\'idées.\r\n\r\n4.Évaluation des solutions : il est important d\'évaluer les solutions potentielles pour déterminer laquelle est la plus appropriée pour résoudre le problème.\r\n\r\n5. Mise en œuvre de la solution : une fois la solution choisie, il est temps de la mettre en œuvre. Cela peut impliquer de prendre des mesures concrètes pour résoudre le problème.\r\n\r\n6. Évaluation des résultats : après avoir mis en œuvre la solution, il est important d\'évaluer les résultats pour savoir si le problème a été résolu de manière satisfaisante.\r\n\r\n7.Amélioration continue : si nécessaire, il peut être nécessaire d\'améliorer ou de modifier la solution pour garantir que le problème ne se reproduise pas à l\'avenir.\r\n\r\nIl est important de noter que ces étapes ne sont pas toujours linéaires et peuvent varier en fonction de la situation. Par conséquent, il est important de s\'adapter et de s\'ajuster en fonction de chaque situation unique pour garantir une gestion efficace des problèmes.', 'evénements', 'Les étapes de gestion d\'un problème ', '2023-04-03 05:48:54', 1),
(48, 'KRppRBOMfW', 'Pygmalion ', '1682246161687.jpg', '\"Un jour, un enfant rentre de l’école avec une lettre pour sa mère. Il lui dit : « Mon instituteur a demandé que je te donne cette lettre, à toi, uniquement à toi. »\r\n\r\nSa mère ouvre alors la lettre, la lit silencieusement, puis déborde de larmes…\r\nElle décide ensuite de lire la lettre à son fils :\r\n\r\n« Votre fils est un génie. Cette école est trop petite pour lui et nous n’avons pas d’assez bons enseignants pour l’instruire. Veuillez le faire vous-même. »\r\n\r\nLa maman décide donc de prendre en charge son enfant.\r\nEntre temps, son fils devient un scientifique de renom.\r\n\r\nAprès le décès de sa chère mère, alors qu’il fouille dans les vieux souvenirs de famille, il trouve une lettre pliée dans une boîte. \r\nIl s’agit de la lettre qu’il avait donnée étant enfant à sa mère de la part de son instituteur. \r\nElle disait ceci :\r\n« Votre fils est un cancre. Il est déficient. On détecte chez lui une maladie mentale. Nous n\'autorisons plus votre fils à revenir à l’école. »\r\nCet enfant, c’était Thomas Edison, l’un des plus grands scientifiques, si ce n’est le plus talentueux, de son époque. Il pleure pendant des heures et il ajoute ceci dans son journal :\r\n\r\n«Thomas Edison était un enfant nul et déficient, qui, grâce a une mère héroïque, est devenu le génie du siècle. »\r\n\r\nVoilà un bel exemple de ce qui est appelé l\'effet Pygmalion à savoir que le regard que l\'on porte sur un autre être humain influence sa réalité et son futur.', 'evénements', 'Pygmalion ', '2023-04-23 11:17:34', 1),
(49, 'ryNvdf0dhM', 'Paroles d\'un leader.', '1672378219207.jpg', 'Paroles d\'un leader :\r\nL\'être est imparfait et la perfection ne peut venir que de l\'imperfection.\r\nQuel est votre défaut ? \r\nQuel est votre handicap ?\r\n\r\nInspirez vous de ces questions pour créer quelque chose de grand puisqu\'il y a en chacun de nous du génie.\r\n\"Ceux qui cherchent à découvrir leur imperfection, trouvent aussi le chemin de la perfection.\"\r\nPortez vous bien et agréable journée chers guerriers.\r\nDesolé pour les messages sans réponses.\r\n', 'evolution', 'Paroles d\'un leader ', '2023-05-02 11:55:59', 1),
(50, 'OgUAXk2c5O', 'Les astuces pour faire face aux découragement ', 'individual-interview-full.jpg', 'COMMENT FAIRE FACE AU DÉCOURAGEMENT ?\r\n\r\nLa vie n’est pas toujours un long fleuve tranquille, elle est un sentier parsemé d’épines, d’embûches, de profondes et d’effroyables frustrations. Seules peuvent être témoins de notre ascension, les différentes vicissitudes par lesquelles nous sommes passés. La véritable leçon de vie n’est pas de n’être jamais tombé, de ne s’être jamais trompé, mais la clé de toute vie empreinte de victoire est la capacité de se relever après un échec, et surtout d’être prédisposé à s’améliorer.\r\n\r\nEn tant qu’humains, il serait déloyal de feindre certaines douleurs sous le voile d’un pseudo stoïcisme. Votre douleur vous ne pourrez la cacher assez longtemps, votre douleur est une partie de vous, car elle vous appartient à vous seul. Les autres peuvent avoir des douleurs ou des frustrations semblables aux vôtres, mais vous êtes seul à pouvoir sucer de leurs venins.\r\n\r\nVoyez-vous, ma vie et mon parcours m’ont assez instruit, et je ne prétends pas avoir déjà atteint le niveau de connaissances ou de compétence que je souhaite vivement atteindre, car je suis encore très médiocre. \r\n\r\nCrier ses douleurs ou hurler ses peines, ce n’est pas être lâche ou faible, c’est être humain. Vider son gosier pour externaliser ses frustrations ne fait pas de vous un poltron, non, ceci fait de vous un homme vivant et conscient de ses peines.\r\n\r\nQuelquefois vous n’avez toujours pas besoin de motivation ou de paroles d’encouragements pour sortir de votre zone de confort ou au mieux pour l’élargir, vous avez simplement besoin de répandre au dehors cette frustration qui vous pollue la pensée. S’il s’agit de pleurer, faites-le. S’il s’agit de vous reposer un instant, faites-le. S’il est plutôt question de vous ouvrir à quelqu’un, faites-le.\r\n\r\nMais ce que vous devez savoir, c’est que les douleurs, ça fait partie du processus de croissance et de maturité de toute personne. Il n’est aucun homme qui ait commencé à marcher sans jamais trébucher. Donc échouer, trébucher, gémir, sentir le désir d’abandon, c’est normal, ça prouve mieux encore que vous pouvez prendre conscience de vos faiblesses et vous améliorer.\r\n\r\nEt si je vous disais que les plus belles leçons de la vie sont celles que nous avons apprises dans les douleurs, les peines, l’angoisse et les trahisons ; que me direz-vous ? Oui en effet, la vie est une succession de leçons qui doivent être vécues pour être comprises. Donc ne méprisez plus vos souffrances, elles sont les jalons d’une nouvelle destinée de gloire.\r\n\r\nIl est vrai qu’un objectif manqué, une affaire plombée et des voiles obscurs sur l’avenir, ça crée le doute, l’incertitude et par conséquent le découragement ; mais vous devez pouvoir comprendre que tous ces signaux représentent des lanternes qui éclairent votre sentier.\r\n\r\nOn est pas très fort pour n’être jamais tombé, mais on est très fort pour avoir porté en soi l’audace de continuer malgré les turpitudes. Et c’est ce qui fait de vous un véritable gagnant. Avant de vous décourager et vouloir jeter l’éponge, posez-vous la question à savoir : QUI SONT CEUX QUI ME REGARDENT COMME UN MODÈLE ? Cette question seule est un véritable carburant pour vous amener à ne rien laisser tomber. Car lorsqu’on a atteint une certaine influence et une certaine crédibilité, on ne s’appartient plus, mais on devient comme quelqu’un le disait FILS DE LA TERRE.\r\n\r\nCroyez-en vous. Osez quelque de différent et d’audacieux, marchez confiant vers votre destinée. Et surtout souriez beaucoup car c’est ainsi qu’on gagne vraiment en confiance et en positivité, surtout en expériences qui vous enrichissent. Si voulez vraiment vaincre LE DÉCOURAGEMENT, SOURIEZ à chacun de vos échecs, remettez-vous en cause, améliorez-vous et RECOMMENCEZ.', 'evénements', 'Comment faire face aux découragement ?', '2023-05-02 12:00:04', 1),
(51, 'TT2Ft8HoJD', 'Le grand secret de ceux qui réussissent.', 'Aaabadinercouple.jpg', '« Le secret de votre réussite est la personne que vous épousez » \r\n–les psychologues–\r\n\r\nQue vous le réalisiez ou non, votre réussite et vos perspectives dans la vie peuvent également dépendre des personnes avec lesquelles vous vous entourez.\r\n\r\nMais la science va encore plus loin.\r\n\r\nSelon les chercheurs, votre succès peut également dépendre de la personne que vous épousez.\r\n\r\nUne étude récemment publiée à l\'Université Carnegie Mellon montre que les conjoints peuvent grandement influer sur les décisions que vous prenez, contribuant finalement à votre succès ou à votre échec.\r\n\r\nAlors choisissez bien et minutieusement votre conjoint(e)', 'evolution', 'Un grand secret de ceux qui ont réussi ', '2023-05-05 10:40:48', 1);
